import './Chat.css'

const Chat = () => {
    return (
            <div className="modulo-chat">
                <div>
                    <span>Imagen</span>
                </div>
                <div>
                    <span>Nombre</span>
                </div>
                <div>
                    <span>Comunicación Asíncrona</span>
                </div>
                <div>
                    <span>Boton</span>
                </div>
            </div>
    );

}

export default Chat;
